import foot from './foot.png';
import olympic from './olympic.png';

const Bodies = () => {
    const [image, setImage] = useState(false);
    setTimeout(() => {
        if(image===false) {
            setImage(true);
            return (
                <p><img src={foot} height="900" width="1200" alt=""/></p>
            )
        } else {
            setImage(false);
            return (
                <p><img src={olympic} height="900" width="1200" alt=""/></p>
            )
        }
    }, 5000);
};

export default Bodies;
